import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() { 
  const r = () => {
    return 10
  }
  return (
    <div className="App">
      <p>{r}</p>
      <img src={logo} className="App-logo" alt="logo" />
    </div>

  );
}

export default App;
